import Vue from 'vue';
import Router from 'vue-router';
import homeContainer from "./components/home/HomeContainer.vue"; //import cakelist from "./components/cakes/Cakelist.vue"

import cakedetails from "./components/cakes/Cakedetails.vue";
import cartContainer from "./components/cakes/cartContainer.vue";
import tabs from "./components/pub/tabs.vue";
import login from "./components/user/login.vue";
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/home',
    component: homeContainer
  }, {
    path: "/",
    redirect: "/home"
  }, //{path:'/home/cakelist',component:cakelist},
  {
    path: '/home/cakelist/cakedetails',
    component: cakedetails
  }, {
    path: '/home/cakelist/cart',
    component: cartContainer
  }, {
    path: '/home/tabs',
    component: tabs
  }, {
    path: '/home/login',
    component: login
  }]
});
